comments.body:
@escowles this has been deployed to staging (VPN required) https://cicognara-staging.princeton.edu/catalog?q=&search_field=all_fields&sort=pub_date_sort+desc%2C+title_sort+asc

Items come sorted properly by year of publication. 

There is one record (ID 3455) that does not display a year to the user but it is sorted correctly if you look at the raw data (https://cicognara-staging.princeton.edu/catalog/3455.json). The issue here is that there is no `tei_date_display` which is what it is used to generate the partials shown to the user, but we do have a date in MARC and the sort is honoring that. I think this is good enough but let me know what you think.
